const { urlToKey, getWorkbook, getSheet } = require(`./index-node.js`)

const url = `https://docs.google.com/spreadsheets/d/104k7dg7Ld_CkwXYKu6bsmZRJK4WdULqyXpMAnQM06Fs/edit?usp=sharing`

const key = urlToKey(url)

getWorkbook(key).then(workbook => {
	console.log(workbook)
	getSheet(key, workbook.sheets[0].id).then(sheet => {
		console.log(sheet)
	})
})
